define(['jquery'],function () {
    /**
     * 加载器 依赖mui.css
     * @param {boolean | string} spinnerUrl  true-使用balls.gif，false-使用CSS3样式，string-使用传入的gif URL
     * @param {string} scope     loader 加载的作用域，默认body，值： ID，Class，tag
     * @example
     * var loader = new Loader();// new Loader(true,'#list')
     * loader.show();
     * loader.hide();
     * loader.destroy();
     * @constructor
     */
    function Loader(spinnerUrl,scope){
        var dimmer = null;              // dimmer ID
        this.msg = "加载中...";         // loader信息
        this.spinnerUrl = spinnerUrl;   // loader url
        this.$dimmer = null;            // dimmer实例化对象
        this.useUrl = !!spinnerUrl;     // loader是否使用链接
        // loader 加载区域
        var $scope = scope && $(scope.indexOf('#') > -1 || scope.indexOf('.') > -1 ? scope : '#'+scope);
        var scoper = scope ? $scope.css('position','relative') : 'body';


        /**
         * 创建并展示loader
         * @param msg   loader提示信息
         */
        this.show = function(msg){
            this._initial(msg);
            $('#' + dimmer).addClass('active');
        };
        // 隐藏
        this.hide = function(){
            $('#' + dimmer).removeClass('active');
        };
        // 销毁
        this.destroy = function(){
            if(!hasInitial()) return;
            this.$dimmer = null;
            $('#'+dimmer).remove();
        };

        this._initial = function(msg){
            var message = msg || this.msg;

            if(!this.$dimmer){
                this.$dimmer = createDimmer();
                dimmer = 'dimmer_' + new Date().getTime();
                this.$dimmer.attr('id',dimmer);

                if(this.useUrl){
                    var $loader = this.$dimmer.find('.loader');
                    $loader.addClass('gif').append('<img src="data:image/gif;base64,"/><p></p>');
                    typeof this.spinnerUrl === 'string' && this.$dimmer.find('img').attr('src',this.spinnerUrl);
                }
            }
            this.useUrl ? this.$dimmer.find('p').text(message) : this.$dimmer.find('.loader').text(message);
            this.$dimmer.appendTo(scoper);
        };
        function createDimmer(){
            return $('<div class="dimmer"><div class="loader text"></div></div>');
        }
        function hasInitial(){
            return !!$('#'+dimmer).length;
        }
    }
    return Loader;
});